B.zk=new A.e1("ynov.jpeg","Mast\xe8re en D\xe9veloppement Logiciel, Mobile & IoT","2021 - 2023","Ynov Lyon Campus","      Le Mast\xe8re Expert en D\xe9veloppement Logiciel, Mobile & IoT est un parcours dans lequel je suis form\xe9 au d\xe9veloppement logiciel avanc\xe9, le d\xe9veloppement mobile et au testing (unitaires, int\xe9grations, fonctionnels...).\n\nLa particularit\xe9 d'Ynov Lyon Campus c'est que nous avons un module nomm\xe9 \"YDays\", ce module consiste \xe0 d\xe9velopper un projet avec plusieurs personnes appartenant \xe0 d'autres formations, par exemple Mast\xe8re Marketing et Communication, Design, Animation 3D, Cloud etc... \n\nLe projet sur lequel je travaille est une application mobile de paris e-Sportif, les technologies choisies sont le Flutter et Firebase.","Lyon, Auvergne-Rh\xf4ne-Alpes, France",null)
B.zl=new A.e1("bm.png","B&M - Pr\xe9parateur de commandes","Ao\xfbt 2020","Contrat d'int\xe9rim","      Emploi saisonnier dans lequel j'avais comme t\xe2ches: \n -Vider des containers de meubles et de cartons pesants plusieurs kilogrammes. \n -A l'aide d'un transpalette, r\xe9cup\xe9rer les meubles command\xe9s par les diff\xe9rents magasins en France, les poser sur des palettes et filmer ces derni\xe8res",u.a,null)
B.zm=new A.e1("uca.png","Licence Professionnelle - D\xe9velopepement sur Plateforme Mobile","2020 - 2021","Bac +3 - Universit\xe9 Clermont Auvergne","      Cette formation m'a permis d'acqu\xe9rir de nombreuses comp\xe9tences dans le domaine du d\xe9veloppement mobile et logiciel. \n\nJ'ai eu l'opportunit\xe9 de d\xe9velopper des applications - dans le cadre de projets scolaires - en diff\xe9rents langages : Java, Kotlin, Swift, Angular... Je me suis \xe9galement investi dans la vie \xe9tudiante puisque j'ai \xe9t\xe9 \xe9lu d\xe9l\xe9gu\xe9 de classe.",u.a,null)
B.zn=new A.e1("apside.png","Apside - D\xe9veloppeur C#","Septembre 2020 - Ao\xfbt 2021","Contrat en alternance","      Durant cette mission j\u2019ai assur\xe9 la maintenance d'une trentaine d'applications au sein d'une TMA (Tierce Maintenance Applicative) pour L'Or\xe9al. J\u2019ai travaill\xe9 sur diff\xe9rentes technologies Microsoft : C#, .NET Framework / .NET Core : ASP.NET / SQL Server + SSMS / Visual Basics.",u.a,null)
B.zo=new A.e1("ynov.jpeg","Expert en Informatique et Syst\xe8mes d'Information","2021 - 2023","Bac +5 - Ynov Lyon - Titre RNCP Niveau 7","      Le Mast\xe8re Expert en D\xe9veloppement Logiciel, Mobile & IoT m\xe8ne \xe0 un Titre RNCP de Niveau 7, ce qui est l'\xe9quivalent d'un Bac +5. \nLe Titre RNCP a pour objectif de permettre aux apprenants de disposer des comp\xe9tences suivantes: \n\n1. Analyser et d\xe9finir la strat\xe9gie du syst\xe8me d\u2019information. \n\n2. Maintenir le syst\xe8me d\u2019information en condition op\xe9rationnelle. \n\n3. G\xe9rer un projet informatique","Lyon, Auvergne-Rh\xf4ne-Alpes, France",null)
B.zp=new A.e1("chaptal.png","Bac STI2D - Option SIN","2015 - 2018","Lyc\xe9e Chaptal","      Le Bac STI2D a \xe9t\xe9 pour moi l'ann\xe9e o\xf9 j'ai \xe9t\xe9 initi\xe9 la programmation et cela m'a donn\xe9 envie de poursuivre mes \xe9tudes dans cette voie. Depuis la classe de Seconde je me suis investi dans la vie du lyc\xe9e","Saint-Brieuc, Bretagne, France",null)
B.zq=new A.e1("cgi.jpg","CGI - Analyse D\xe9veloppeur","Mai 2020 - Juin 2020","Stage","      D\xe9veloppement d'un outil de migration de donn\xe9es (MongoDB/Neo4J/ReactiveX/VertX) Dans un contexte compliqu\xe9, c'est confin\xe9 que j\u2019ai relev\xe9 les d\xe9fis et les probl\xe9matiques qui se sont pr\xe9sent\xe9 \xe0 moi. Plus une opportunit\xe9 qu'une contrainte, le confinement m\u2019a permis de diversifier mes exp\xe9riences professionnelles et d\u2019accro\xeetre mon autonomie, mon organisation et ma capacit\xe9 de communication.",u.a,null)
B.zr=new A.e1("uca.png","DUT Informatique","2020 - 2021","Bac +2 - Universit\xe9 Clermont-Auvergne","      Ce Dipl\xf4me Universitaire Technologique m'a permis de d\xe9velopper mes comp\xe9tences en programmation, notamment en Algorithmie avec le C et en Programmation Orient\xe9e Objet avec du Java, puis en C#. \n\nDurant ces deux ann\xe9es j'ai \xe9t\xe9 d\xe9l\xe9gu\xe9 de classe et membre du Club Info. \n\nLe Club Info est une association qui se d\xe9roule tous les Jeudis \xe0 partir de 13h, on y d\xe9veloppe des projets avec des associations, des \xe9coles ou des projets personnels. \n\nParticiper au club m'a permis de grandement m'am\xe9liorer en d\xe9veloppement.",u.a,null)
B.zs=new A.e1("marine.jpg","Pr\xe9paration Militaire Marine","2017 - 2018","Marine Nationale - Mention Tr\xe8s Bien","      Dans le cadre de cette Pr\xe9paration Militaire Marine nous avons appris les diff\xe9rents rudiments de la vie de militaire, la marche au pas, participer \xe0 des c\xe9r\xe9monies... nous avons \xe9t\xe9 embarqu\xe9 \xe0 bord de plusieurs b\xe2timents et mis en condition de combat lors d'une s\xe9ance de tir au FAMAS. \u2705 Cette formation a renforc\xe9e certaines qualit\xe9s comme l'esprit d'\xe9quipe, l'organisation, la minutie et la ponctualit\xe9. Je serai donc un atout fiable et actif dans votre organisation.","Saint-Brieuc, Bretagne, France",null)
B.zt=new A.e1("marine.jpg","Marine Nationale - R\xe9serviste","Ao\xfbt 2017 - Juillet 2020","R\xe9serve Op\xe9rationnelle","      Durant cette mission dans la r\xe9serve op\xe9rationnelle Marine, j'\xe9tais r\xe9guli\xe9rement mobilis\xe9 \xe0 l'Arsenal de Brest pour effectuer diff\xe9rentes missions : Service g\xe9n\xe9ral, surveillance de site... J'ai pu y accro\xeetre certaines de mes comp\xe9tences comme la rigueur et l'autonomie par le biais de t\xe2ches intellectuelles ou physiques. Mon serieux et mon assiduit\xe9 ont \xe9t\xe9 r\xe9compens\xe9s par une notation annuelle \xe9logieuse ainsi qu'une mont\xe9e en grade (Matelot de Premi\xe8re Classe [MO1]) ","Brest, Bretagne, France",null)
B.zu=new A.e1("apside.png","Apside - D\xe9veloppeur Flutter","Septembre 2021 - Aujourd'hui","Contrat en alternance","      Je travaille au sein du Lab Apside Lyon sur un projet de co-pi\xe9tonnage en Flutter. Cette application va permettre aux utilisateurs de partager - avec d'autres personnes - des portions de trajets communes. L'application va proposer un service de statistiques aux entreprises et aux municipalit\xe9s sur les zones de fortes fr\xe9quentations, des heures de pointes, des zones \"blanches\" ainsi que des lignes \xe0 privil\xe9gier.","Lyon, Auvergne-Rh\xf4ne-Alpes, France",null)
